import React, { Component } from 'react';

class navbar extends Component {
    render() {
        const count = this.props.habitCount;
        return (
            <div><i className="fa-solid fa-leaf"></i>Habit Tracker<span className="habit-count">{count}</span></div>

        );
    }
}

export default navbar;
